func x64Hash(str string, num int) string {
	aZ := len(str) % 16
	b0 := len(str) - aZ
	b1 := []int{0, num}
	b2 := []int{0, num}
	b3 := []int{0, 0}
	b4 := []int{0, 0}
	b5 := []int{2277735313, 289559509}
	b6 := []int{1291169091, 658871167}
	b7 := 0
	for b7 = 0; b7 < b0; b7 += 16 {
		b3 = []int{charCodeAt(str, b7+4)&255 | leftShift((charCodeAt(str, b7+5)&255), 8) | leftShift((charCodeAt(str, b7+6)&255), 16) | leftShift((charCodeAt(str, b7+7)&255), 24),
			charCodeAt(str, b7)&255 | leftShift((charCodeAt(str, b7+1)&255), 8) | leftShift((charCodeAt(str, b7+2)&255), 16) | leftShift((charCodeAt(str, b7+3)&255), 24)}
		b4 = []int{charCodeAt(str, b7+12)&255 | leftShift((charCodeAt(str, b7+13)&255), 8) | leftShift((charCodeAt(str, b7+14)&255), 16) | leftShift((charCodeAt(str, b7+15)&255), 24),
			charCodeAt(str, b7+8)&255 | leftShift((charCodeAt(str, b7+9)&255), 8) | leftShift((charCodeAt(str, b7+10)&255), 16) | leftShift((charCodeAt(str, b7+11)&255), 24)}
		b3 = at(b3, b5)
		b3 = au(b3, 31)
		b3 = at(b3, b6)
		b1 = aw(b1, b3)
		b1 = au(b1, 27)
		b1 = as(b1, b2)
		b1 = as(at(b1, []int{0, 5}), []int{0, 1390208809})
		b4 = at(b4, b6)
		b4 = au(b4, 33)
		b4 = at(b4, b5)
		b2 = aw(b2, b4)
		b2 = au(b2, 31)
		b2 = as(b2, b1)
		b2 = as(at(b2, []int{0, 5}), []int{0, 944331445})
	}
	b3 = []int{0, 0}
	b4 = []int{0, 0}
	for i := aZ; i > 0; i-- {
		switch i {
		case 15:
			b4 = aw(b4, av([]int{0, charCodeAt(str, b7+14)}, 48))
		case 14:
			b4 = aw(b4, av([]int{0, charCodeAt(str, b7+13)}, 40))
		case 13:
			b4 = aw(b4, av([]int{0, charCodeAt(str, b7+12)}, 32))
		case 12:
			b4 = aw(b4, av([]int{0, charCodeAt(str, b7+11)}, 24))
		case 11:
			b4 = aw(b4, av([]int{0, charCodeAt(str, b7+10)}, 16))
		case 10:
			b4 = aw(b4, av([]int{0, charCodeAt(str, b7+9)}, 8))
		case 9:
			b4 = aw(b4, []int{0, charCodeAt(str, b7+8)})
			b4 = at(b4, b6)
			b4 = au(b4, 33)
			b4 = at(b4, b5)
			b2 = aw(b2, b4)
		case 8:
			b3 = aw(b3, av([]int{0, charCodeAt(str, b7+7)}, 56))
		case 7:
			b3 = aw(b3, av([]int{0, charCodeAt(str, b7+6)}, 48))
		case 6:
			b3 = aw(b3, av([]int{0, charCodeAt(str, b7+5)}, 40))
		case 5:
			b3 = aw(b3, av([]int{0, charCodeAt(str, b7+4)}, 32))
		case 4:
			b3 = aw(b3, av([]int{0, charCodeAt(str, b7+3)}, 24))
		case 3:
			b3 = aw(b3, av([]int{0, charCodeAt(str, b7+2)}, 16))
		case 2:
			b3 = aw(b3, av([]int{0, charCodeAt(str, b7+1)}, 8))
		case 1:
			b3 = aw(b3, []int{0, charCodeAt(str, b7)})
			b3 = at(b3, b5)
			b3 = au(b3, 31)
			b3 = at(b3, b6)
			b1 = aw(b1, b3)
		}
	}
	b1 = aw(b1, []int{0, len(str)})
	b2 = aw(b2, []int{0, len(str)})
	b1 = as(b1, b2)
	b2 = as(b2, b1)
	b1 = ax(b1)
	b2 = ax(b2)
	b1 = as(b1, b2)
	b2 = as(b2, b1)
	output := ""
	lmao, _ := strconv.Atoi("00000000" + fmt.Sprint(trippleShift(b1[0], 0)))
	a := fmt.Sprintf("%x", lmao)
	if len(a) > 8 {
		a = a[len(a)-8:]
	}
	output += a
	lmao, _ = strconv.Atoi("00000000" + fmt.Sprint(trippleShift(b1[1], 0)))
	a = fmt.Sprintf("%x", lmao)
	if len(a) > 8 {
		a = a[len(a)-8:]
	}
	output += a
	lmao, _ = strconv.Atoi("00000000" + fmt.Sprint(trippleShift(b2[0], 0)))
	a = fmt.Sprintf("%x", lmao)
	if len(a) > 8 {
		a = a[len(a)-8:]
	}
	output += a
	lmao, _ = strconv.Atoi("00000000" + fmt.Sprint(trippleShift(b2[1], 0)))
	a = fmt.Sprintf("%x", lmao)
	if len(a) > 8 {
		a = a[len(a)-8:]
	}
	output += a
	return output
}

func trippleShift(num, t int) int {
	overflow := int32(num)
	return int(uint32(overflow) >> t)
}

func av(aX []int, aY int) []int {
	aY %= 64
	if aY == 0 {
		return aX
	}
	if aY < 32 {
		return []int{leftShift(aX[0], aY) | trippleShift(aX[1], 32-aY), leftShift(aX[1], aY)}
	}
	return []int{leftShift(aX[1], aY-32), 0}
}

func at(aX, aY []int) []int {
	aX = []int{trippleShift(aX[0], 16), aX[0] & 65535, trippleShift(aX[1], 16), aX[1] & 65535}
	aY = []int{trippleShift(aY[0], 16), aY[0] & 65535, trippleShift(aY[1], 16), aY[1] & 65535}
	aZ := []int{0, 0, 0, 0}
	aZ[3] += aX[3] * aY[3]
	aZ[2] += trippleShift(aZ[3], 16)
	aZ[3] &= 65535
	aZ[2] += aX[2] * aY[3]
	aZ[1] += trippleShift(aZ[2], 16)
	aZ[2] &= 65535
	aZ[2] += aX[3] * aY[2]
	aZ[1] += trippleShift(aZ[2], 16)
	aZ[2] &= 65535
	aZ[1] += aX[1] * aY[3]
	aZ[0] += trippleShift(aZ[1], 16)
	aZ[1] &= 65535
	aZ[1] += aX[2] * aY[2]
	aZ[0] += trippleShift(aZ[1], 16)
	aZ[1] &= 65535
	aZ[1] += aX[3] * aY[1]
	aZ[0] += trippleShift(aZ[1], 16)
	aZ[1] &= 65535
	aZ[0] += aX[0]*aY[3] + aX[1]*aY[2] + aX[2]*aY[1] + aX[3]*aY[0]
	aZ[0] &= 65535
	return []int{leftShift(aZ[0], 16) | aZ[1], leftShift(aZ[2], 16) | aZ[3]}
}

func au(aX []int, aY int) []int {
	aY %= 64
	if aY == 32 {
		return []int{aX[1], aX[0]}
	}
	if aY < 32 {
		return []int{leftShift(aX[0], aY) | trippleShift(aX[1], 32-aY), leftShift(aX[1], aY) | trippleShift(aX[0], 32-aY)}
	}
	aY -= 32
	return []int{leftShift(aX[1], aY) | trippleShift(aX[0], 32-aY), leftShift(aX[0], aY) | trippleShift(aX[1], 32-aY)}
}

func aw(aX, aY []int) []int {
	return []int{aX[0] ^ aY[0], aX[1] ^ aY[1]}
}

func as(aX, aY []int) []int {
	aX = []int{trippleShift(aX[0], 16), aX[0] & 65535, trippleShift(aX[1], 16), aX[1] & 65535}
	aY = []int{trippleShift(aY[0], 16), aY[0] & 65535, trippleShift(aY[1], 16), aY[1] & 65535}
	aZ := []int{0, 0, 0, 0}
	aZ[3] += aX[3] + aY[3]
	aZ[2] += trippleShift(aZ[3], 16)
	aZ[3] &= 65535
	aZ[2] += aX[2] + aY[2]
	aZ[1] += trippleShift(aZ[2], 16)
	aZ[2] &= 65535
	aZ[1] += aX[1] + aY[1]
	aZ[0] += trippleShift(aZ[1], 16)
	aZ[1] &= 65535
	aZ[0] += aX[0] + aY[0]
	aZ[0] &= 65535
	return []int{leftShift(aZ[0], 16) | aZ[1], leftShift(aZ[2], 16) | aZ[3]}
}

func ax(aX []int) []int {
	aX = aw(aX, []int{0, trippleShift(aX[0], 1)})
	aX = at(aX, []int{4283543511, 3981806797})
	aX = aw(aX, []int{0, trippleShift(aX[0], 1)})
	aX = at(aX, []int{3301882366, 444984403})
	aX = aw(aX, []int{0, trippleShift(aX[0], 1)})
	return aX
}

func leftShift(num, t int) int {
	overflow := int32(num)
	return int(overflow << t)
}

func charCodeAt(str string, n int) int {
	if len(str) == 0 || len(str) < n {
		return 0
	}

	return int([]rune(str)[n])
}

